// Массивы с данными для названий книг и обложек (в формате Base64)
const bookTitles = [
    "Название книги 1",
    "Название книги 2",
    "Название книги 3",
    "Название книги 2",
    "Название книги 3"
];

const bookCovers = [
    "data:image/png;base64,"
    // Добавьте больше строк Base64 для дополнительных обложек
];

// Функция для создания и добавления элемента книги в список книг
function addBook(title, cover) {
    const bookList = document.querySelector('.book-list');

    // Создаем новый элемент книги
    const bookItem = document.createElement('div');
    bookItem.classList.add('book-item');

    // Создаем элемент обложки книги
    const bookCover = document.createElement('div');
    bookCover.classList.add('book-cover');
    bookCover.style.backgroundImage = `url(${cover})`; // Устанавливаем фоновое изображение

    // Создаем элемент названия книги
    const bookTitle = document.createElement('div');
    bookTitle.classList.add('book-title');
    bookTitle.textContent = title; // Устанавливаем текст названия

    // Добавляем обложку и название в элемент книги
    bookItem.appendChild(bookCover);
    bookItem.appendChild(bookTitle);

    // Добавляем элемент книги в список книг
    bookList.appendChild(bookItem);
}

// Обработчик события для кнопки "плюс"
document.getElementById('plus').addEventListener('click', () => {
    window.location.href = '/functionbook';
});

// Проходим по массивам и добавляем книги в список
for (let i = 0; i < bookTitles.length; i++) {
    addBook(bookTitles[i], bookCovers[i]);
}